// src/GamezopEmbed.js
import React from 'react';
import Header from '../header/Header';
import Footer from '../footer/Footer';

const QuizComponent = () => {
  // const gameUrl = 'https://www.newszop.com/';
const gameUrl = 'https://play.gamezop.com/te/intro?int-nav=1'
  return (
    <>
     <Header/>

<div className="game-container">
  <iframe
    title="Gamezop Game"
    src={gameUrl}
    className="game-iframe"
  />
</div>
      <Footer/>

    </>

  );
};

export default QuizComponent;
